import "./card.styles.css";

const Card = ({ monster }) => {
  <h1>hi</h1>;
  const { id, name, email } = monster;
  return (
    <div className="card-container" key={id}>
      <img
        alt={`monsters ${name}`}
        src={`https://robohash.org/${id}?set=set4&size=180x180`}
      />
      <h2>{name}</h2>
      <p>{email}</p>
    </div>
  );
};

export default Card;
